цинский центр, специализирующийся на лечении тяжелых детских неврологических и психических болезней: ДЦП, синдрома Дауна, расстройств аутистического спектра, СДВГ, задержки речевого и психического развития. \r\n\\\"Нужные и важные благотворительные программы были свернуты в силу того, что меня невзирая на презумпцию невиновности назначили виноватым по уголовному делу о создании финансовой пирамиды в инвестиционной компании \\\"Гермес\\\", в которой я никогда не был и не являюсь ни учредителем, ни генеральным директором\\\", — Василенко, по его словам, работал с клиентами компании как коуч и консультант. \r\n \r\nЭто, замечает он, иностранная инвестиционная компания, которая, кстати, после проблемного периода, связанного с, возможно, заказным обрушением клиентских сервисов и платежной системы, осуществленным российским IT-специалистом, который создавал IT-ресурсы, вполне успешно работает. \r\n \r\nВасиленко подчеркивает, что благотворительные программы финансировались из его личных доходов от коучинга, финансового консалтинга, частных инвестиций, а также с помощью юрлиц, принадлежавших лично Роману Василенко. \r\nПочти два года расследовалось уголовное дело, в котором Василенко проходит в качестве одного из обвиняемых, — оно вроде бы только завершено, хотя может быть продлено и характер обвинений постоянно меняется. \\\"А теперь выясняется, — говорит он, — что ущерб в окончательной версии обвинений — 232 млн руб., которые будут еще оспариваться адвокатами\\\". \r\n \r\nРоман Василенко убежден, что благотворительные программы будут восстановлены, как только суд рассмотрит уголовное дело по существу и необоснованность обвинений станет очевидной и закрепленной судебными решениями.', 'Дело \\\"Гермес\\\": что за кадры с передачей наличных показали по \\\"Рен-ТВ\\\"? \r\n<a href=https://www.pravda.ru/realty/1863327-delo_germes/>Кооператив Bestway </a> \r\nЗавершение расследования (по крайней мере, формальное) уголовного дела, которое следствие связывает с компаниями \\\"Г